import React from 'react';
import prevarrow from './images/prev-arrow.png'
import nextarrow from './images/white-next-arrow.png'
import './App.css';
import Home from './components/home';
import { BrowserRouter , Routes , Route } from 'react-router-dom';

function App() {
  return (
    <div>
      <BrowserRouter>
        <div id = "header">
      <img src = {prevarrow} alt = "arrow" class = "arrow"/>
        <a>Brand</a>
        <a>Search Dishes</a>
        <a>Search Restaurants</a>
        <a><i class="fa-solid fa-cart-shopping"></i> Cart</a>
      <img  src = {nextarrow} alt = "arrow"/>
      </div>
      <Routes>
        <Route path = "/" element = {<Home/>}></Route>
        <Route path = "*" element = {<h1 style = {{textAlign : "center"}}>404 Page Not Found</h1>}></Route>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
